import React from "react";
import Message from "../message/Message";
import logo from "../../assets/logo.png";

const FeedContainer = () => {
  return (
    <section className="feed">
      <Message content="Lorem Ipsum" />
      avatar={logo} />
    </section>
  );
};

export default FeedContainer;
